import React from 'react'

// import components
import Header from '../Header-Footer/Header'
import Footer from '../Header-Footer/Footer'

const About = () => {
  return (
    <>
    <Header />
    <div className="text-center font-[800] text-4xl p-24">
        <h1>Francis the man</h1>
    </div>
    <Footer />
    </>
  )
}

export default About
